import { useEffect, useState } from "react";
import { getFetchData } from "../utils/getFetchData";
import CardWrap from "./CardWrap";
import FolderTopContainer from "./FolderTopContainer";

const FolderMainContainer = () => {
  const [userData, setUserData] = useState({
    id: null,
    created_at: null,
    favorite: null,
  });

  useEffect(() => {
    const fetchFolder = async () => {
      try {
        const getResult = await getFetchData(`/api/users/1/folders`);
        setUserData(getResult.data);
        console.log(getResult);
      } catch (error) {
        console.error(error);
      }
    };

    fetchFolder();
  }, []);

  return (
    <>
      {/* <FolderTopContainer {...userData} /> */}
      <CardWrap folders={userData} />
    </>
  );
};

export default FolderMainContainer;
